CREATE TABLE encounter_method_prose (
	encounter_method_id INT NOT NULL, 
	local_language_id INT NOT NULL, 
	[name] VARCHAR(79) NOT NULL, 
	PRIMARY KEY (encounter_method_id, local_language_id), 
	FOREIGN KEY(encounter_method_id) REFERENCES encounter_methods (id) ON UPDATE CASCADE ON DELETE NO ACTION, 
	FOREIGN KEY(local_language_id) REFERENCES languages (id) ON UPDATE CASCADE ON DELETE NO ACTION
);
--GO
--DROP TABLE IF EXISTS encounter_conditions;
CREATE TABLE encounter_conditions (
	id INT NOT NULL, 
	identifier VARCHAR(79) NOT NULL, 
	PRIMARY KEY (id)
);
--GO
--DROP TABLE IF EXISTS encounter_condition_values;
CREATE TABLE encounter_condition_values (
	id INT NOT NULL, 
	encounter_condition_id INT NOT NULL, 
	identifier VARCHAR(79) NOT NULL, 
	is_default BIT NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(encounter_condition_id) REFERENCES encounter_conditions (id) ON UPDATE CASCADE ON DELETE NO ACTION, 
	CHECK (is_default IN (0, 1))
);
--GO
--DROP TABLE IF EXISTS encounter_condition_value_prose;
CREATE TABLE encounter_condition_value_prose (
	encounter_condition_value_id INT NOT NULL, 
	local_language_id INT NOT NULL, 
	[name] VARCHAR(79) NOT NULL, 
	PRIMARY KEY (encounter_condition_value_id, local_language_id), 
	FOREIGN KEY(encounter_condition_value_id) REFERENCES encounter_condition_values (id) ON UPDATE CASCADE ON DELETE NO ACTION, 
	FOREIGN KEY(local_language_id) REFERENCES languages (id) ON UPDATE CASCADE ON DELETE NO ACTION
);
--GO
--DROP TABLE IF EXISTS encounter_condition_value_map;
CREATE TABLE encounter_condition_value_map (
	encounter_id INT NOT NULL, 
	encounter_condition_value_id INT NOT NULL, 
	PRIMARY KEY (encounter_id, encounter_condition_value_id), 
	FOREIGN KEY(encounter_id) REFERENCES encounters (id) ON UPDATE CASCADE ON DELETE NO ACTION, 
	FOREIGN KEY(encounter_condition_value_id) REFERENCES encounter_condition_values (id) ON UPDATE CASCADE ON DELETE NO ACTION
);
